import styled from "styled-components";

export const Table = styled.input`
    width: 100%,
    borderCollapse: collapse,
    marginBottom: 20px,
`;

export const Input = styled.input`
    outline: none;
    padding: 16px 20px;
    width: 100%;
    border-radius: 5px;
    margin-top: 1em;
    font-size: 16px;
    background-color: #f0f2f5;
    border: none;
`;
